import React, { useState } from "react";

const Home=()=>{
    const[name,setname]=useState({firstname:'',lastname:''});

    return(
      <div>
        <input type="text" value={name.firstname}
        onChange={(e)=>{setname(e.target.value)}}
        />
        <input type="text" value={name.lastname}
        onChange={(e)=>{setname()}}
        />
      </div>  
    );
}

export default Home;
